// client/src/components/MitigationForm.js
import React, { useState } from "react";
import axios from "axios";
import "../styles.css";

export default function MitigationForm() {
  const [job, setJob] = useState({
    customer: "",
    address: "",
    claimNumber: "",
    jobType: "",
    paymentStatus: "",
    insuranceWaiting: "",
    rooms: [],
    psychrometricTable: "",
    finalSummary: "",
  });

  const addRoom = () => {
    setJob({ ...job, rooms: [...job.rooms, { name: "", readings: "", photo: "" }] });
  };

  const updateRoom = (index, key, value) => {
    const newRooms = [...job.rooms];
    newRooms[index][key] = value;
    setJob({ ...job, rooms: newRooms });
  };

  // ============== AI REQUESTS ==============
  const generateRoomAI = async (index) => {
    const room = job.rooms[index];
    const res = await axios.post("http://localhost:5000/ai/room-summary", room);
    alert("AI Summary:\n\n" + res.data.summary); // show popup
  };

  const generatePsychrometric = async () => {
    const res = await axios.post("http://localhost:5000/ai/psychrometric");
    setJob({ ...job, psychrometricTable: res.data.table });
  };

  const generateFinalReport = async () => {
    const res = await axios.post("http://localhost:5000/ai/final-summary", { job });
    setJob({ ...job, finalSummary: res.data.summary });
  };

  return (
    <div className="container">
      <h1>ðŸ›  ToolbeltAI â€” Mitigation Logger</h1>

      {/* JOB FIELDS */}
      <input placeholder="Customer Name" onChange={(e) => setJob({ ...job, customer: e.target.value })} />
      <input placeholder="Job Address" onChange={(e) => setJob({ ...job, address: e.target.value })} />
      <input placeholder="Claim Number" onChange={(e) => setJob({ ...job, claimNumber: e.target.value })} />

      <select onChange={(e) => setJob({ ...job, jobType: e.target.value })}>
        <option>Select Job Type</option>
        <option>Water</option>
        <option>Fire</option>
        <option>Mold</option>
      </select>

      <select onChange={(e) => setJob({ ...job, paymentStatus: e.target.value })}>
        <option>Select Payment Status</option>
        <option>Paid</option>
        <option>Pending</option>
        <option>Waiting on Insurance</option>
      </select>

      {/* ROOMS */}
      <h2>ðŸ“¸ Rooms & Moisture Readings</h2>
      {job.rooms.map((room, index) => (
        <div key={index} className="room-box">
          <input placeholder="Room Name" onChange={(e) => updateRoom(index, "name", e.target.value)} />
          <textarea placeholder="Moisture Readings" onChange={(e) => updateRoom(index, "readings", e.target.value)} />
          <input type="file" onChange={(e) => updateRoom(index, "photo", e.target.files[0]?.name || "")} />
          <button onClick={() => generateRoomAI(index)}>âœ¨ AI Room Summary</button>
        </div>
      ))}
      <button onClick={addRoom}>âž• Add Another Room</button>

      {/* PSYCHROMETRIC */}
      <h2>ðŸ“Š Psychrometric Table</h2>
      <button onClick={generatePsychrometric}>âš™ Generate Psychrometric Table (AI)</button>
      <textarea value={job.psychrometricTable} readOnly />

      {/* FINAL REPORT */}
      <button onClick={generateFinalReport}>ðŸ“„ AI Final Insurance Summary</button>
      <textarea value={job.finalSummary} readOnly />
    </div>
  );
}
